using System;\nusing Oracle.DataAccess.Client;\n\nclass Program\n{\n    static void Main()\n    {\n        string connectionString = "User Id=yourUsername;Password=yourPassword;Data Source=yourDataSource;";\n        \n        using (OracleConnection connection = new OracleConnection(connectionString))\n        {\n            connection.Open();\n            \n            using (OracleCommand command = new OracleCommand("YourStoredProcedureName", connection))\n            {\n                command.CommandType = System.Data.CommandType.StoredProcedure;\n\n                // Add parameters if necessary\n                // command.Parameters.Add(new OracleParameter("param1", value));\n\n                OracleDataReader reader = command.ExecuteReader();\n\n                while (reader.Read())\n                {\n                    Console.WriteLine(reader["columnName"].ToString());\n                }\n            }\n        }\n    }\n}